import React from "react";
import { Box } from "@material-ui/core";

function TrendIcon() {
    return (
        <Box>
            <Box
            sx={{
                height: '30px',
                width: '25px'
            }} 
            component='img'
            src='/vectors/trend.png'
            alt='trend_logo'
            />
            <p>Trend</p>
        </Box>

    )
}

export default TrendIcon;
